import React, { useEffect } from 'react';

import { useTranslation } from 'react-i18next';
import { useParams } from "react-router-dom";
import { TabView, TabPanel } from 'primereact/tabview';

import { GeneralInformation } from './GeneralInformation';

export const PersonalCustomerDetail = () => {
    const { t } = useTranslation('common');
    const { id } = useParams();

    useEffect(() => {
        document.title = t('common:title.CustomerDetail');

        return () => {
            document.title = t('common:title.homepage');
        }
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, []);

    return (
        <div className="p-grid">
            <div className="p-col-12">
                <div className="card">
                <h4>{t('title.CustomerDetail')}</h4>
                <TabView>
                    <TabPanel header={t('customer.generalInformation')}>
                        <GeneralInformation partyId={id} />
                    </TabPanel>
                    {/* <TabPanel header={t('customer.representative')}>
                        <h5>{t('customer.representative')}</h5>
                    </TabPanel> */}
                </TabView>
                </div>
            </div>
        </div>
    );
}
